import React from "react"

const PokemonList = (props) => {
    const pokemonList = props.pokemonData.map((pokemon) => {
         return (
             <React.Fragment>
                 <div>
                       <li>
                            <div>{pokemon.id}</div>
                            <div><img src ={pokemon.sprite.front_default} alt='pokemon sprite'/></div>
                            <div>{pokemon.name}</div>
                        </li>
                    </div>
                </React.Fragment>
            )
            })
        
    return (
        <h3>Hello</h3>
    )
}
export default PokemonList
